import { createUseStyles } from "react-jss";

const DeliveryPage = () => {

    const styles = createUseStyles({
        listItem: {
            marginLeft: "80px",
            width: "100%",
            backgroundRepeat: "no-repeat",
            backgroundPosition: "top right"
        },
        delivery: {
            backgroundImage: "url(../../../images/delivery.png)"
        }
    });

    const classes = styles()

    return (
        <div className={classes.listItem + classes.delivery}>
            <h3 className="services-list-item-title">Доставка</h3>
            <p className="services-list-item-desc">Мы с удовольствием доставим ваш товар прямо<br />
                к вашему подъезду совершенно бесплатно!<br />
                Ведь мы неплохо заработаем,<br />
                поднимая его на ваш этаж!</p>
        </div>
    )
}

export default DeliveryPage
